import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 3.2-2603 Aquaculture Advisory Board membership terms; compensation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-2603.md","filePath":"vacode/3.2-2603.md"}'),o={name:"vacode/3.2-2603.md"},s=t('<h1 id="§-3-2-2603-aquaculture-advisory-board-membership-terms-compensation" tabindex="-1">§ 3.2-2603 Aquaculture Advisory Board membership terms; compensation. <a class="header-anchor" href="#§-3-2-2603-aquaculture-advisory-board-membership-terms-compensation" aria-label="Permalink to &quot;§ 3.2-2603 Aquaculture Advisory Board membership terms; compensation.&quot;">​</a></h1><p>A. The terms for appointments to the Aquaculture Advisory Board shall be for four years. Appointments to fill vacancies shall be for the unexpired term.</p><p>B. Members of the Aquaculture Advisory Board shall receive no compensation for their services but shall receive reimbursement for actual expenses.</p><p>1992, c. 643, § 3.1-73.8; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0577" target="_blank" rel="noreferrer">577</a>.</p>',4),i=[s];function n(c,l,p,m,u,d){return r(),a("div",null,i)}const f=e(o,[["render",n]]);export{h as __pageData,f as default};
